window.bookSummaryJSON = "<p>What would you do if you discovered a five million dollar superyacht unmanned and adrift, a trail of blood across the deck and a bikini-clad blonde with a knife in her back? That’s exactly what Florida salvage captain Seychelle Sullivan finds when she responds to a strange woman’s Mayday call. </p> <p>Worse, the missing skipper is Neal Garrett, her ex.</p> <p>But when she ties the salvaged yacht to the Coast Guard dock, the Fort Lauderdale detective zeroes in on her as a suspect and raises questions. Questions she can’t answer.</p> <p>Is Neal dead or alive­? </p> <p>Who is the dead blonde? </p> <p>And who owns the lavish yacht Seychelle just salvaged?</p> <p>She wants answers, too. Her business is in trouble, and this salvage claim against a yacht worth millions just might save her from having to sell her beloved tugboat <i>Gorda</i>.</p> <p><b>If you like hair-raising sea stories, tales of Florida's underworld, and chase scenes through the Everglades, you'll love </b><b><i>Surface Tension</i></b><b> and Seychelle Sullivan. Get it now.</b></p>"; 
